import React, { Component } from 'react';


import hamburgerMenu from "../../pictures/hamburger_menu.png"

// import allEars from "../../pictures/allears.png";
// import pause from "../../pictures/pause.png";
// import stopShare from "../../pictures/stopshare.png";

// import check from "../../pictures/check.png";
// import redX from "../../pictures/redx.png";

// import axios from 'axios';

class Page8 extends Component {
    
    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
       this.handleScroll()
    }


    hamburgerClick = (event) => {
        if (this.state.hamburger_is_clicked === true){
            this.setState({hamburger_is_clicked: false, options: '', rotation: 0, xShift: 0, yShift: 0 })
        }

        else if (this.state.hamburger_is_clicked === false){
            this.setState({hamburger_is_clicked: true,
            options: 
            <div>
                <h2 className='step_option' onClick={event => this.stepClick(event, 1)}>Step1</h2>
                <h2 className='step_option' onClick={event => this.stepClick(event, 2)}>Step2</h2>
                <h2 className='step_option' onClick={event => this.stepClick(event, 3)}>Step3</h2>
                <h2 className='step_option' onClick={event => this.stepClick(event, 4)}>Step4</h2>
                <h2 className='step_option' onClick={event => this.stepClick(event, 5)}>Step5</h2>
            </div>
        })
        }
    }

    stepClick = (e, choice) => {
        if (choice === 1){
            this.setState({curr_component: <Step1 />})
        }
        else if (choice === 2){
            this.setState({curr_component: <Step2 />})
        }
        
    }

    state = {
        hamburger_is_clicked: false,
        curr_component: <Step1 />, 
        options: ''
        }

    render() {
        return (
            <div className="sheet">
                <h1 id="p8title" className="bold center">Practicing coping strategies</h1>
                <div id="page8" className='left container_for_small_margin'>
                    <img className={this.state.hamburger_is_clicked ? "rotate" : "no_rotate"} src={hamburgerMenu} alt="Hamburger menu icon" id="hamburger_menu_script_9" onClick={(event) => this.hamburgerClick(event)} />
                    {/* <p>
                        We'll practice your new strategy together.  
                    </p> */}
                </div>
            </div>
        )
    }
}
export default Page8;


